import styled from 'styled-components'

const Wrapper = styled.div`
    padding:50px 80px;
`;

const Head = styled.h2`
    text-align: center;
    color: grey;
`;

export default function Loans() {
    return (
        <Wrapper>
            <Head>
                Select a Loan Product
            </Head>
        </Wrapper>
    )
}
